poly = np.polynomial.Polynomial.fit(x_3, y_3, 5)
# Now interpolate delays between 20 and 30 seconds by evaluating polynomial
x_eval = np.arange(900, 1301)   # [900 to 1200] in minutes
y_eval = poly(x_eval)        # here we evaluate the polynomial
plt.plot(x_3, y_3, 'co', label='input to fitter3', markersize = 4)
plt.plot(x_eval, y_eval, 'm--', label='interpolation 3', linewidth=1.0)

plt.xlabel('Time (seconds)')
plt.ylabel('Delay value')
# plt.axis([0, 60, 0, 1.4])
plt.legend(loc='upper center', bbox_to_anchor=(0.5, -0.05) , ncol=3)
plt.show()
